import React from 'react';
import './Biography.css'

function Biography () {
    return (
        <div class='container' >
            <div class='column_left'>
                <h1>Learn More About Noel</h1>
                <br />
                <p>
                    Noel Amador Luna is a first-generation college graduate with a strong technical background and a passion for data-driven decision-making. Raised by migrant workers, Noel learned the value of hard work and perseverance, which inspired him to pursue higher education despite financial and logistical challenges. He earned a Bachelor of Science in Computer Science with a Minor in French from St. Edward’s University in Austin, Texas, and a Master of Science in Business Analysis and Strategic Management from The University of Manchester (Alliance Business School) in Manchester, England. Currently works as a Senior Sales Engineer at Experian.<br />
                    <br />Throughout his career, Noel has honed his skills in technical project coordination and client-facing roles, successfully delivering complex solutions for large financial institutions. With his blend of technical expertise and client experience, Noel is committed to becoming a well-rounded business leader, using data and strategic thinking to drive organizational success. His story reflects a dedication to overcoming challenges, continuous learning, and inspiring others to pursue their academic and professional goals. <br />
                    <br />In his free time, Noel enjoys a variety of hobbies that allow him to explore both his creative and adventurous side. Photography is one of his passions, as he loves capturing moments and landscapes that tell a story, whether it’s a vibrant city scene or a peaceful nature shot. Cooking is another favorite pastime, where he experiments with new recipes and flavors, often inspired by his travels. He finds great joy in preparing meals that bring people together. When not in the kitchen or behind the camera, Noel can often be found outdoors, whether hiking, biking, or simply exploring new places. His love for traveling fuels his curiosity about different cultures, cuisines, and landscapes, and he always seeks new adventures that broaden his perspective and inspire his creative pursuits.
                </p>
            </div>
            <div class='column_right'>
                <img src="/images/IMG_0872.JPG" class='image' alt=''/>
            </div>
        </div>

    );
}

export default Biography;
